import React, { useEffect, useState } from 'react';

const Player = () => {
    const { topArtistas, setTopArtistas } = useState({});

    useEffect(() => {
        fetch('http://ws.audioscrobbler.com/2.0/?method=chart.gettopartists&api_key=cfedf7f80f5776d69845ed9dd0b397e3&format=json ')
            .then(response => {
                if (response.ok)
                    return response.json();
            
                throw new Error('error');
            }).then(result => {
                setTopArtistas(result);
            })
    }, []);

    return(
        <div>
                Hello world!
        </div>
    );
}

export default Player;
